import React, { PureComponent } from "react";
import { RadialChart } from "react-vis";
import AppLayout from "../components/AppLayout";

const Profile = () => {
  const data = [
    { angle: 0, radius: 10 },
    { angle: 45, radius: 20 },
    { angle: 90, radius: 30 },
    { angle: 135, radius: 40 },
    { angle: 180, radius: 50 },
    { angle: 225, radius: 60 },
  ];

  return (
    <div style={{ textAlign: "center" }}>
      <RadialChart data={data} width={300} height={300} showLabels />
    </div>
  );
};
